(1, 'For graduates of 2024] Career track', '', 'Recycling, real estate, customers, web advertising, media, DX', 'Comprehensive work', 'Osaka, Tokyo, Kanagawa, Chiba, Saitama, Sendai, Shizuoka, Nagoya, Hyogo, Okayama, Hiroshima, Fukuoka, and other locations nationwide', '2022-07-04 10:56:00', '2023-07-30 09:56:00', 1, 33, 'Human Resources Department', 'Hiring at Rext Holdings Co., Ltd.\n                After joining \"Real Estate Co., Ltd.\", which develops real estate business centered on the sale of asset-management condominiums,\n                or \"Purchase and sales business of kimonos, antiques, stamps, tableware, jewelry, brands, watches, etc.\" REGATE Co., Ltd.,\n                or Rext Customer Service Co., Ltd., which operates the customer business of the Rext HD Group,\n                or IZA Co., Ltd., which conducts the advertising and planning business of the Rext HD Group,\n                or solicitation and investment funds for the Rext HD Group.\n                You will be assigned to either \"Lext Asset Management Co., Ltd.\", which operates the operation business, or \"Lext Shared Service Co., Ltd.\", which is responsible for the corporate departments such as human resources, general affairs, accounting, and IT strategy of the Lext HD Group .\n                *The assignment will be officially decided after the training.', '2023-07-26 01:28:48', '2023-07-30 01:28:48', NULL, NULL, NULL);
